const Navbar = () => {
  return (
    <nav calssName="navbar navbar-expand-lg bg-body-tertiary">
      <div calssName="container-fluid">
        <a calssName="navbar-brand" href="#">Navbar</a>
        <button calssName="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span calssName="navbar-toggler-icon"></span>
        </button>
        <div calssName="collapse navbar-collapse" id="navbarNav">
          <ul calssName="navbar-nav">
            <li calssName="nav-item">
              <a calssName="nav-link active" aria-current="page" href="#">Home</a>
            </li>
           
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
